import React, { FC } from "react";
import PropTypes from 'prop-types';

interface ButtonProps {
    type: string;
    children: string;
}

const Button: FC<ButtonProps> = ({type, children}) => {
    return (
        <button type={type}>{children}</button>
    )
}

